export default function About() {
  return (
    <section id="about" className="py-16 px-6 max-w-3xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">About Me</h2>
      <p>
        I am a second-year student at AKGEC, learning Machine learning.
      </p>
    </section>
  );
}
